Bir nokta $P$'den düzgün bir oktahedronun beş köşesine olan mesafeler 3, 7, 8, 9 ve 11'dir. $P$'den altıncı köşeye olan mesafeyi bulun.

[asy]
import three;

size(125);
currentprojection = perspective(6,3,1);

triple A, B, C, D, E, F, P;

A = (1,0,0);
B = (-1,0,0);
C = (0,1,0);
